"use client"

import { useState } from "react"
import { useNavigate, Link } from "react-router-dom"
import AppLayout from "../components/AppLayout"

function Login() {
  const [email, setEmail] = useState("")
  const [password, setPassword] = useState("")
  const [isLoading, setIsLoading] = useState(false)
  const [error, setError] = useState("")
  const navigate = useNavigate()

  const handleLogin = async (e) => {
    e.preventDefault()
    setError("")
    setIsLoading(true)

    try {
      // Simuler une requête d'authentification
      await new Promise((resolve) => setTimeout(resolve, 1000))

      // Dans une application réelle, vous feriez une requête à votre API
      // const response = await fetch('/api/login', {
      //   method: 'POST',
      //   headers: { 'Content-Type': 'application/json' },
      //   body: JSON.stringify({ email, password }),
      // });
      // const data = await response.json();

      // Pour la démonstration, nous acceptons n'importe quel email avec un mot de passe de "password123"
      if (password === "password123") {
        // Stocker les informations d'authentification
        localStorage.setItem("auth", JSON.stringify({ email, isAuthenticated: true }))
        navigate("/dashboard")
      } else {
        setError("Identifiants invalides. Essayez avec le mot de passe: password123")
      }
    } catch (err) {
      setError("Une erreur est survenue lors de la connexion")
    } finally {
      setIsLoading(false)
    }
  }

  return (
    <AppLayout title="Connexion" color="purple">
      <div className="max-w-md mx-auto">
        <div className="bg-[#1a1a2e] border border-purple-900/30 rounded-lg p-6 backdrop-blur-sm">
          <form onSubmit={handleLogin} className="space-y-6">
            <div>
              <label htmlFor="email" className="block text-sm font-medium text-gray-400 mb-2">
                Adresse email
              </label>
              <input
                id="email"
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
                className="w-full bg-[#0f0f1a] border border-purple-900/30 rounded-md px-4 py-3 text-white focus:outline-none focus:ring-2 focus:ring-purple-500"
                placeholder="votre@email.com"
              />
            </div>

            <div>
              <label htmlFor="password" className="block text-sm font-medium text-gray-400 mb-2">
                Mot de passe
              </label>
              <input
                id="password"
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
                className="w-full bg-[#0f0f1a] border border-purple-900/30 rounded-md px-4 py-3 text-white focus:outline-none focus:ring-2 focus:ring-purple-500"
                placeholder="••••••••"
              />
            </div>

            {error && <div className="p-3 bg-red-500/20 border border-red-500/30 rounded-md text-red-400">{error}</div>}

            <div>
              <button
                type="submit"
                disabled={isLoading}
                className={`w-full bg-purple-600 hover:bg-purple-700 text-white py-3 rounded-md transition-colors ${
                  isLoading ? "opacity-50 cursor-not-allowed" : ""
                }`}
              >
                {isLoading ? "Connexion en cours..." : "Se connecter"}
              </button>
            </div>

            <div className="text-center text-sm text-gray-400">
              <p>
                Vous n'avez pas de compte ?{" "}
                <Link to="/register" className="text-purple-400 hover:text-purple-300">
                  Créer un compte
                </Link>
              </p>
              <p className="mt-2">
                <Link to="/forgot-password" className="text-purple-400 hover:text-purple-300">
                  Mot de passe oublié ?
                </Link>
              </p>
            </div>
          </form>
        </div>

        <div className="mt-6 p-4 bg-[#0f0f1a] rounded-md border border-purple-900/30">
          <h3 className="text-lg font-semibold mb-3 text-purple-400">Informations de connexion</h3>
          <p className="text-gray-300 text-sm">
            Pour cette démonstration, vous pouvez utiliser n'importe quelle adresse email avec le mot de passe:{" "}
            <span className="font-mono bg-[#1a1a2e] px-2 py-1 rounded">password123</span>
          </p>
        </div>
      </div>
    </AppLayout>
  )
}

export default Login
